/* Event structure for event `prueba` */

/*!50106 DROP EVENT IF EXISTS `prueba`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`salas`@`%` EVENT `prueba` ON SCHEDULE EVERY 1 DAY STARTS '2019-07-28 12:47:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
      UPDATE USUARIO_EXTERNO SET ESTADO_EXTERNO = 0
      WHERE ESTADO_EXTERNO = 1 AND DOCUMENTO_PERSONA=2;
    END */$$
DELIMITER ;

