/* Event structure for event `salida_st` */

/*!50106 DROP EVENT IF EXISTS `salida_st`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`salas`@`%` EVENT `salida_st` ON SCHEDULE EVERY 1 DAY STARTS '2019-07-29 10:15:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
