      WHERE ESTADO=1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `SP_SALIDA_EXTERNO` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_SALIDA_EXTERNO` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`salas`@`%` PROCEDURE `SP_SALIDA_EXTERNO`(in documento INTEGER)
BEGIN   
	DECLARE num INTEGER;
	declare est integer;        	     
        DECLARE c1 CURSOR FOR 
                     SELECT ESTADO_EXTERNO FROM USUARIO_EXTERNO
                     WHERE  DOCUMENTO_PERSONA=documento and ESTADO_EXTERNO = 1;
	open c1;
	 c1:loop
            fetch c1 into est;
	    update USUARIO_EXTERNO set ESTADO_EXTERNO=0 ;
	 end loop c1; 
	close c1 ;
	END */$$
DELIMITER ;

